import { Button, Form, Input } from "antd";

import { IUpdatePetLifeStyles } from "@shared/interfaces";

interface IInitialValues {
    name: string
}

interface IFProps {
    initialValues?: IInitialValues
    onFinish?: (values: IUpdatePetLifeStyles) => void
    isLoading?: boolean
}

const PetLifeStyleUpdateForm: React.FC<IFProps> = ({ initialValues, onFinish, isLoading }) => {
    return (
        <Form
            size="middle"
            layout="vertical"
            initialValues={initialValues}
            onFinish={onFinish}>
            <Form.Item
                label="Life Style Name"
                name="name">
                <Input defaultValue={initialValues?.name} />
            </Form.Item>

            <Form.Item>
                <Button loading={isLoading} type="primary" htmlType="submit">
                    Submit
                </Button>
            </Form.Item>
        </Form>
    );
};

export default PetLifeStyleUpdateForm;
